CREATE TABLE `zxcms_config` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `xtname` char(100) NOT NULL COMMENT '系统名称',
  `xtkefu` char(100) NOT NULL DEFAULT '1' COMMENT '客服qq',
