  `zgstatus` tinyint(11) DEFAULT '0' COMMENT '挂中的有效状态，0-有效，1-无效',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

