insert  into `zxcms_gonggao`(`id`,`title`,`content`,`addtime`,`is_show`) values (6,'2019春节放假通知！！！','<p>\r\n	通知通知通知\r\n</p>\r\n<p>\r\n	万德商城<br />\r\n万众一同同德\r\n</p>\r\n<p>\r\n	年春节放假通知\r\n</p>\r\n<p>\r\n	2月2号放假—2月8号营业\r\n</p>\r\n<p>\r\n	2月1号—2月15号停止入驻\r\n</p>\r\n<p>\r\n	2月16号开放每天入驻2—3名\r\n</p>\r\n<p>\r\n	2月8号—4月15号<br />\r\n（十个 周日内 正常 发货 收货）<br />\r\n4月15号后恢复周日正常休息\r\n</p>\r\n<p>\r\n	2019万德商城<br />\r\n新老顾客们及家人们‼<br />\r\n新春愉快','2019-01-31 13:15:40',1),(8,'超人计划良心互助','<p>\r\n	万德商城\r\n</p>\r\n<p>\r\n	公告公告公告<br />\r\n因❗平台发货ZJ太过于拥堵<br />\r\n请看后台数据❗<br />\r\n如：<br />\r\n现在每天收货卖出30000左右<br />\r\n待买入的购物总额为1033600<br />\r\n已经远远大于收货卖出额度的30多倍<br />\r\n所以导致新老会员的进场速度缓慢<br />\r\n经过各经销商市场领导人和诚信会员建议❗<br />\r\n万德商城：<br />\r\n运营部决定如下！！！\r\n</p>\r\n<p>\r\n	第<br />\r\n原静态会员6个月降息40%<br />\r\n自3月2号开始静态会员8个月降息40%<br />\r\n【2019年3月2号之前的会员静态也是8个月降息】<br />\r\n推荐一名延长三个月<br />\r\n推荐两名延长六个月<br />\r\n推荐三名永久不降息‼<br />\r\n第<br />\r\n连续两次超过上午9:30分发货的会员将会延迟3天匹配进场！！！<br />\r\n连续三次超过上午9:30分发货的会员将会延迟5天匹配进场！！！<br />\r\n连续超过五次上午9:30分发货的会员《平台劝退》感恩有你！！！<br />\r\n第<br />\r\n商城发货ZJ太过于充足！<br />\r\n商城依然每天入驻——名<br />\r\n【增加入驻名额，待通知】\r\n</p>\r\n<p>\r\n	万德商城<br />\r\n良心做盘 诚信做事❗<br />\r\n按需发展 限制入驻❗<br />\r\n不为暴力 只为长久❗\r\n</p>\r\n<p>\r\n	万德商城<br />\r\n运营部3月1日&nbsp;&nbsp; 诺‼\r\n</p>','2019-04-25 09:05:05',1),(9,'超人计划  资金过于充足停止入驻！！！','<p>\r\n	万德商城\r\n</p>\r\n<p>\r\n	公告公告公告<br />\r\n因❗平台发货ZJ太过于拥堵<br />\r\n万德商城决定如下：<br />\r\n3月26号停止商城入驻\r\n</p>\r\n<p>\r\n	于 4月1号开放商城入驻\r\n</p>\r\n<p>\r\n	万德商城<br />\r\n山东运营部&nbsp; 诺❗\r\n</p>\r\n<p>\r\n	2019年3月23号\r\n</p>','2019-04-25 09:04:44',1);

