/*Table structure for table `zxcms_rule` */

DROP TABLE IF EXISTS `zxcms_rule`;

CREATE TABLE `zxcms_rule` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(11) DEFAULT NULL COMMENT '计划id',
  `rulename` char(100) DEFAULT NULL COMMENT '名称',
  `option01` varchar(255) DEFAULT NULL COMMENT 'bssd-大小单双,twostar-二星,threestar-三星,fourstar-四星,fivestar-五星',
  `option02` varchar(255) DEFAULT NULL COMMENT 'unit-个,ten-十,hundred-百,thousand-千,wan-万,beforetwo-前二,aftertwo-后二,beforethree-前三,middlethree-中三,afterthree-后三,beforefour-前四,afterfour-后四,none-无',
  `option03` varchar(255) DEFAULT NULL COMMENT 'position-定位,big-大,small-小,single-单,double-双,singlemode-单式,doublemode-复式,danma-胆码,groupthree-组三,groupsix-组六',
  `option04` varchar(255) DEFAULT NULL COMMENT '定位号码',
  `count` int(11) DEFAULT NULL COMMENT '注数',
  `codelength` int(11) DEFAULT NULL COMMENT '出号位数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

