/*Table structure for table `zxcms_user` */

DROP TABLE IF EXISTS `zxcms_user`;

CREATE TABLE `zxcms_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '父id',
  `account` varchar(200) DEFAULT NULL COMMENT '账号名称',
  `password` char(40) DEFAULT NULL COMMENT '密码',
  `paystatus` tinyint(1) DEFAULT '0' COMMENT '支付状态0是未支付',
  `daoqitime` datetime DEFAULT NULL COMMENT '到期时间',
  `regtime` datetime DEFAULT NULL COMMENT '注册时间',
  `token` varchar(200) DEFAULT NULL COMMENT 'token',
  `newstatus` tinyint(1) DEFAULT '0' COMMENT '新人状态0是新人',
  `forbiddenstatus` tinyint(1) DEFAULT '0' COMMENT '禁用状态0是不禁用',
  `dlsstatus` tinyint(1) DEFAULT '0' COMMENT '代理商状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

